import React from "react";

const RouterContact = () => {
    return (
        <>
            <div className="container w-75 mt-5 py-5" style = {{border:" 2px solid"}} >
                <div className="row contactService">
                    <h1>Contact us for any Suggestions or queries</h1>
                    
                    <div className="col-md-4 col-12 py-3 text-center" style = {{border:" 2px solid"}}>
                        <button type="button" className="btn btn-lg btn-primary" disabled>Primary button</button>
                    </div>
                    <div className="col-md-4 col-12  py-3 text-center" style = {{border:" 2px solid"}}>
                        <button type="button" class="btn btn-lg btn-primary" disabled>Primary button</button>
                    </div>
                    <div className="col-md-4 col-12  py-3 text-center" style = {{border:" 2px solid"}}>
                        <button type="button" class="btn btn-lg btn-primary" disabled>Primary button</button>
                    </div>

                </div>
            </div>
        </>
    );
}

export default RouterContact;
